import "./card.css";
import TextWithTitle from "./text-with-title";

class Card extends Component {
  state = {

  };
  render() {
    return (
      <div className="card">
        <div className="top-section">
    <div className="title">{this.props.record.patientName}</div>
          <div className="date">{this.props.record.date}</div>
        </div>
        <div className="content-section">
        {this.props.descript.map(item => {
          return <TextWithTitle key={item.key} content={item} />;
        })}
        </div>

      </div>
    );
  }
}

export default Card;
